import styled from "styled-components";

export const AboutStyle = styled.div`
  width: 100%;
  height: 100%;
  display: flex;
  flex-direction: column;
  align-items: center;
  background-color: red;
  color: white;
`;

export const SubAboutStyle = styled.div`
  width: 80%;
  height: 100%;
  display: flex;
  flex-direction: column;
  align-items: start;
  background-color: orange;
  color: white;
`;
